        <Card>
            <img src={props.img} ></img>
            <Card.Content>
                <Card.Header>{props.name}</Card.Header>
            </Card.Content>
            <Card.Content extra>
                    <a>
                        <Icon name='money bill alternate outline' />
                            {props.money} $
                    </a>
            </Card.Content>
        </Card>

        );
}
